import React from "react";
import Grid from "material-ui/Grid";
import Button from "material-ui/Button";
import Card, { CardActions, CardContent, CardMedia } from "material-ui/Card";
import Typography from "material-ui/Typography";
import { LinearProgress } from "material-ui/Progress";

const data = [
  {
    title: "Malaria nets in Uganda",
    caption:
      "Give malarianets to a village in Uganda. This is the most effective prevention.",
    percentage: 30,
    donated: 400,
    target: 1000,
    image:
      "data:image/jpeg;base64,"
  },
  {
    title: "Disaster Relief in Syria",
    caption: "Help the refugees in Syria with tents and blankets",
    percentage: 65,
    donated: 15409,
    target: 20000,
    image:
      "data:image/jpeg;base64,"
  }
];

class Project extends React.Component {
  render() {
    const {
      title,
      caption,
      image,
      percentage,
      donated,
      target
    } = this.props.item;
    return (
      <Grid item xs={12} sm={6}>
        <Card style={{ textAlign: "left" }}>
          <CardMedia
            style={{ height: 200 }}
            image={image}
            title="Contemplative Reptile"
          />
          <CardContent>
            <div style={{ height: 120 }}>
              <Typography gutterBottom variant="headline" component="h2">
                {title}
              </Typography>
              <Typography component="p">{caption}</Typography>
            </div>
            <div style={{ marginTop: 20 }}>
              <LinearProgress variant="determinate" value={percentage} />
            </div>
            <Typography component="headline">
              Donated ${donated} of ${target}
            </Typography>
          </CardContent>
          <CardActions>
            <Button size="small" color="primary">
              Donate
            </Button>
            <Button size="small" color="primary">
              Learn More
            </Button>
          </CardActions>
        </Card>
      </Grid>
    );
  }
}

class Projects extends React.Component {
  render() {
    return (
      <Grid container spacing={24}>
        {data.map((x, i) => {
          return <Project key={i} item={x} />;
        })}
      </Grid>
    );
  }
}

export default Projects;
